import React from "react"
import {Link} from "react-router-dom"

function Home() {
    return (
      <div className=" flex justify-center items-center h-[100vh] bg-gradient-to-br from-[#09203f]  via-[#2d4a69] to-[#537895]">
        <button className="bg-none border-2 border-[#e9f3fe] text-white">
          <Link to="/speech">Get Started</Link>
        </button>
      </div>
    );
}

export default Home
